"use strict";var gulp=require("gulp"),imagemin=require("gulp-imagemin");gulp.task("imagemin",function(){gulp.src("../imagemin/*.{png,jpg,gif,ico}").pipe(imagemin({optimizationLevel:5,progressive:true,interlaced:true,multipass:true})).pipe(gulp.dest("../imagemin/normal"))});var pngquant=require("imagemin-pngquant");gulp.task("imagemindeep",function(){gulp.src("../imagemin/*.{png,jpg,gif,ico}").pipe(imagemin({progressive:true,svgoPlugins:[{removeViewBox:false}],use:[pngquant()]})).pipe(gulp.dest("../imagemin/deep"))});var cache=require("gulp-cache");gulp.task("imageminmodify",function(){gulp.src("../imagemin/*.{png,jpg,gif,ico}").pipe(cache(imagemin({progressive:true,svgoPlugins:[{removeViewBox:false}],use:[pngquant()]}))).pipe(gulp.dest("../imagemin/modified"))});gulp.task("default",["imagemin","imagemindeep","imageminmodify"]);